// Navbar.jsx
import React, { useState } from 'react';
import './Navbar.css';
import mentorImg from './mentor.png';
import Modal from './Modal';
import Placement from '../pages/Placement';
import HumanDetection from '../pages/HumanDetection'; // if it exists

function Navbar() {
  const [activeProject, setActiveProject] = useState(null);

  const openProject = (name) => {
    setActiveProject(name);
  };

  const closeModal = () => {
    setActiveProject(null);
  };

  const renderProjectComponent = () => {
    switch (activeProject) {
      case 'Placement Predictor':
        return <Placement />;
      case 'Human Detection':
        return <HumanDetection />;
      default:
        return null;
    }
  };

  const projects = [
    { name: 'Placement Predictor' },
    { name: 'Human Detection' },
  ];

  return (
    <div className="navbar-container">
      <div className="header">
        <img src={mentorImg} alt="Hanumat Lal Vishwakarma" className="mentor-img" />
        <div className="text-info">
          <h1 className="name">MY PORTFOLIO</h1>
          <p className="tagline">HANUMAT LAL VISHWAKARMA</p>
          <p className="about">
            Position: Software Engineer at Rakuten Group Inc. Tokyo, Japan.<br />
            Qualifications: M.tech(CSE) at IIT Ropar, B.Tech(CSE) at NIT Manipur.<br />
            Skills: C/C++, Python, SQL, Numpy, Pandas, Matplotlib, Sklearn, Pytorch, Tensorflow, Machine learning,
            Deep Learning, HTML/CSS, React, Javascript, Jenkins, Docker, Kubernetes, Data Structure and Algorithm,
            DBMS, Linux, Git and Github.<br />
          </p>
        </div>
      </div>

      <div className="project-links">
        {projects.map((project) => (
          <button
            key={project.name}
            className="project-link"
            onClick={() => openProject(project.name)}
          >
            {project.name}
          </button>
        ))}
      </div>

      <Modal isOpen={!!activeProject} onClose={closeModal}>
        {renderProjectComponent()}
      </Modal>
    </div>
  );
}

export default Navbar;
